(1, 1, 'neutral-running-shoes_FBle', 'Neutral Running Shoes', 'Shoes for every day running on the road', '<h2>Upgrade Your Collection With Neutral Running Shoes</h2>\r\n\r\n<p>No matter what the time or place it, now you can run without any trouble with the right set of running shoes by your side. There are different types of runners all over the world. Some would like to run on the track with a predefined path in order to develop a pattern, while the other lot would like to run in the wild, in an uneven or fortified path in order to really experience their jogging session to its best. It doesn&rsquo;t matter what kind of runner you are, but with these neutral running shoes, you are bound to fulfil every requirement of yours.</p>\r\n\r\n<p>There is a reason why these shoes are so much in demand. They let a runner jog in every kind of condition, without any trouble. Neutral shoes are also extremely lightweight in nature and let a runner attain just the right balance they want. They are preferred by thousands of fitness enthusiasts out there, as they are fit not only to be taken on the track or in the wild, but you can also hit the gym while wearing these amazing shoes.</p>', 'NeutralRunningShoes_1637584328.jpg', NULL, 20, 1, 1, 'Neutral running shoes', 'Neutral running shoes', 'Neutral running shoes', '2021-10-27 11:35:56', '2022-02-05 14:20:32'),
(2, 1, 'fitness-shoes_NbQC', 'Fitness shoes', 'Shoes for gym and fitness exercises', '<h2>Buy Your Next Pair Of Fitness Shoes From Us</h2>\r\n\r\n<p>Every runner is particular about the way they jog. There are plenty of fitness enthusiasts out there who prefers nothing else than a good and comfortable pair of fitness shoes to accompany them during their running sessions. These shoes are not only durable in nature, but are also composed of lightweight materials that enable the runner to have a flawless leg movement. If you are buying a new pair of shoes for the purpose of walking or jogging, then we must recommend one of these shoes. They will certainly let you warm up to your fitness regime and you can easily hit the gym in style while wearing these.</p>\r\n\r\n<p>It is the overall composition and design of these training shoes that sets them apart from their counterparts. They have an uneven sole which is designed in such a way that it would optimize the effort and energy of a runner. Since it has an uneven sole, it will make sure that heel region is dropped at a lower stage that the rest of the foot. This will help you maintain a better synchronization while running and you would attain a flawless composition without any trouble. The composition guarantees to put you at ease while letting you stay comfortable during those long strolls.</p>', 'Fitnessshoes_1637589800.jpg', NULL, 40, 1, 1, 'Fitness shoes', 'Fitness shoes for gym exercises and fitness', 'fitness shoes, gym exercises, street training', '2021-10-27 11:35:56', '2022-02-05 14:20:27'),
(4, 1, 'competition-shoes', 'Competition shoes', 'Shoes for running competions or very fast runnings', '<h2>Running shoes for experienced runners</h2>\r\n\r\n<h3>Fast light running shoes</h3>\r\n\r\n<p>Every fitness enthusiast and runner knows that in order to get better, they need to beat their own record. When it comes to running, your biggest competitor is yourself and in order to bring an edge to the way you jog, you need the support of some of the best running shoes out there. In order to let our customers experience a great time shopping with us, we have handpicked some of the best competition shoes from a range of various brands like Asics, Li-Ning, Puma, Nike, Adidas, and a lot more. One can see how we have collected such a diverse range of brands, letting our customers have no excuse to buy their favourite products.</p>\r\n\r\n<p>This is one of the main reasons why Jogging-Point is such a reputed name in the industry. We are one of the most recommended online stores to buy running products as we have a diverse range that is presented in an easy to navigate manner. We have provided various filters so that our customers can pick the product they like the most of the basis of their gender, colour choice, size, the ongoing promotion, the preferred brand, and a lot more.</p>', 'Competitionshoes_1637582432.jpg', NULL, 10, 1, 0, 'Competition shoes', 'Competition shoes', 'Competition shoes', '2021-10-27 11:35:56', '2021-12-20 13:14:26'),
(6, 1, 'trail-shoes_BiY5', 'Trail shoes', 'Trail shoes for running on field, trails, mountain', '<h2>Get A Perfect Pair Of Trail Running Shoes</h2>\r\n\r\n<p>If you would like to run on the grass, terrains, or outdoors, then you certainly can&rsquo;t ask for a better pair. Trail running shoes are specially engineered for those who would like to run outdoors and on softer surfaces. You might be wondering what makes these shoes so different form their counterparts. One of the major characteristics which set these shoes apart is their design. These shoes are comparatively less cushioned than other kinds of shoes, letting you run without any trouble on softer surfaces.</p>\r\n\r\n<p>Trail shoes are composed in such a way that they produce a great amount of friction. As while running on the grass, one of the major difficulties comes regarding friction. Theses shoes will make sure that you won&rsquo;t slip or face any other kind of fatal injury while running. Also, they have a lower ground and a smaller heel, which makes it easier for runners to jog on terrains without facing any difficulty.</p>', 'Trailshoes_1637588662.jpg', NULL, 30, 1, 1, 'Trail shoes', 'Trail shoes to run on trail and soft surfaces', 'shoes for trails, mountain, wood and soft surfaces', '2021-10-27 11:35:56', '2022-02-05 14:20:55'),
(8, 2, 'running-shorts_s9J2', 'Running shorts', 'Running short for cool and warm weather', '<h2>Running shorts for race and fast trainning sessions</h2>\r\n\r\n<p>With the assistance of these remarkable running clothing products, you are sure to outshine everyone on the running tracks. It doesn&rsquo;t matter if you are preparing for a competition or if you like to jog to stay fit, with the help of these branded items, you will certainly feel a difference. You would stay more focussed and at ease for hours, so that you can level up the efficiency of your fitness regime.</p>\r\n\r\n<p>If you are inspired by professional runners like Henry Rono, David Moorcroft, Deena Kastor, Irina Mikitenko, Lemi Hayle, and more, then you should definitely do something unique and inspiring as well. With these durable running clothes, you can surely make your dreams come true. They will come handy to you on different occasions and will keep being your companion during those long running sessions for the days to come. Just include the ones you like the most to your cart and complete your purchase.</p>', 'Runningshorts_1637916520.jpg', NULL, 30, 1, 1, 'running shorts', 'running shorts for competion and fast training session', 'running shorts, fast trainings, competition, race running', '2021-10-27 11:35:56', '2022-02-05 14:20:21'),
(9, 2, 'running-pants-qyv3_S3Jq', 'Running pants', 'Shorts and pants for running on every wheater', '<h2>Running pants for cold and warm wheather</h2>\r\n\r\n<p>Each runner has individual needs; therefore we want to provide you with a couple of hints to help you find your perfect running outfit.</p>\r\n\r\n<p><em>It is really important to measure correctly. </em></p>\r\n\r\n<p>Here a couple of rules on how to measure your sizes:</p>\r\n\r\n<p>Hold the measuring tape close but not too tight around the to-be measured part of the body. If you measure yourself alone, try to measure each part a couple of times and take the average of the measurements. Otherwise ask someone for help. Keep in mind that children keep growing so you might have to measure more frequently.</p>', 'Runningpants_1637610527.jpg', NULL, 10, 1, 1, 'Running pants', 'Running pants', 'Running pants', '2021-10-27 11:35:56', '2022-02-05 14:21:05'),
(12, 2, 'running-socks_qsa1', 'Running socks', 'Running socks for confort racing and trainning', '<h2>Running socks for training and competitions</h2>\r\n\r\n<p>Runners obsess over every detail of a <a href=\"https://www.runnersworld.com/gear/a19663621/best-running-shoes/\">running shoe</a> to make sure they have comfort dialed for every step. But many of us will still jam an old cotton sock between that pricey shoe and our foot. The humble sock, however, plays an important role in keeping you dry and warm (or cool).</p>\r\n\r\n<h3>Materials Matter</h3>\r\n\r\n<p>First off, avoid cotton at all costs. Sure, you could safely make it through a 3-mile recovery run in a pair that came from a 12-pack, but on hot or wet days you&rsquo;ll find cotton absorbs an incredible amount of water and easily <a href=\"https://www.runnersworld.com/health-injuries/a19574724/blister-treatment-and-prevention/\">causes blisters</a>. Merino wool, on the other hand, is a fiber you can wear year-round thanks to its ability to regulate temperature, move moisture, and <a href=\"https://www.runnersworld.com/gear/a20859367/how-to-get-rid-of-smelly-shoes/\">resist odors</a>. You&rsquo;ll find it used in many pairs of <a href=\"https://www.runnersworld.com/gear/a20863096/best-compression-socks/\">performance socks</a>. Most, however, use a mix of synthetic fabrics&mdash;nylon, polyester, and spandex&mdash;which offers good value and durability, plus prevents irritation.</p>', 'Runningsocks_1637917209.jpg', NULL, 40, 1, 1, 'running socks', 'running socks for confortable running', 'running socks, competion socks, warm socks', '2021-10-27 11:35:56', '2022-02-05 14:20:14'),
